import styled from "styled-components";

export const ContentSection=styled.section`
    text-align:center;
    padding-top: 7.5rem;
    padding-bottom: 7.5rem;
`
export const Title = styled.p`
    font-family: fantasy;
    font-size: 3rem;
    color: #000000;
    background: #FFFFFF;
    text-shadow: 6px 4px 5px rgba(109,121,134,0.61);
    `
export const Text = styled.p`
    font-color: #4682B4;
    font-family:fantasy;
`
